    //this got moved to the wipe_model() API call...... 
    theDomain.clearAll();
    theMachine.shutdown();

    cout << "Process # " << rank << " ended with exitflag = " << exitflag << endl;
#else
    exitflag = start_parser(argc, argv);
#endif


    return exitflag;
